import React, { useEffect } from 'react';
import Row from './Row';

const Grid = ( { grid, reload }) => {

  useEffect(() => {
    console.log('GRID COMPONENT');
  }, [reload])

  return (
    <div className="grid">
      <div>
        {grid.map((row, i)=> {
          return <Row row={row} key={i} i={i} grid={grid} />
        })}
      </div>
    </div>
  )
}

export default Grid
